transforms.result:
  .cards-bloc {
      display: flex;
      margin-bottom: 5rem;
      flex-wrap: wrap;
      width: 100%;
      justify-content: space-around;
      
  }

  .card {
    height: 11rem;
    width: 13rem;
    margin: 0.6rem; 
    padding: 1.2rem;
    background-color: rgba(71, 70, 70, 0.404);
    display: flex;
    flex-direction: column;
    align-items: center;
    border-radius: 6px;
    border: 0.1px solid rgba(0, 159, 227, 0.349);
    transition: 0.4s ease-in-out;
  }
  .card:hover {
    transition: all 0.4s ease-in-out;
    transform: scale(1.04);
    border: 0.1px solid rgba(0, 159, 227, 0.973); 
  }
  .card-icon {
      height: 4rem;
      width: 3rem;
      background-repeat: no-repeat;
      background-size: 100%;
  }
  .liste-text {
    width: 100%;
  }
  p {
      font-size: 0.7rem;
      font-family: mpluslight;
      font-weight: bold;
      text-align: center;
      line-height: 0.7rem;
  }

  /* version mobile */
@media screen and (max-width: 900px) {
    
    .card {
      border: 0.1px solid rgba(0, 159, 227, 0.973); 
    }
    .card-icon {
      height: 3rem;
    }
    .liste-text {
      padding-top: 1.2rem;
    }
}

@media screen and (max-width: 700px) {
  .cards-bloc {
      display: flex;
      flex-direction: column;
    }
}
